The formula contains magic numbers (-99.999, 20, 2, 100) that make the calculation unclear. Consider extracting these as named constants with descriptive names to explain their purpose and make the formula more maintainable.
```suggestion
    // Constants for close distance threshold calculation
    private const double CLOSE_DISTANCE_SLOPE = -99.999;
    private const double CLOSE_DISTANCE_DIVISOR = 20;
    private const double CLOSE_DISTANCE_ZOOM_OFFSET = 2;
    private const double CLOSE_DISTANCE_BASE = 100;

    private static double GetCloseDistanceThresholdKMFrom(double zoomLevel)
    {
        return CLOSE_DISTANCE_SLOPE / CLOSE_DISTANCE_DIVISOR * (zoomLevel - CLOSE_DISTANCE_ZOOM_OFFSET) + CLOSE_DISTANCE_BASE;
```
